import Reservation from '../../../models/Reservation';

export default {
  Query: {
    reservation: (root, args) => {
      return new Promise((resolve, reject) => {
        Reservation.findOne(args).exec((err, res) => {
          err ? reject(err) : resolve(res);
        });
      });
    },

